function changeOurSize(player, message) {
  if (player.team != 0 && !tookASize.hasOwnProperty(player.id)) {
    let size = message.substr("!size ".length);
    if (!isNaN(size) && size >= MIN_SIZE && size <= MAX_SIZE) {
      room.setPlayerDiscProperties(player.id, {
        radius: size,
        invMass: size / 30,
      });
      tookASize[player.id] = size;
    } else {
      room.sendAnnouncement(
        "Sólo puedes elegir entre los siguientes tamaños: " +
          MIN_SIZE +
          " y " +
          MAX_SIZE,
        player.id,
        0xbfff35,
        "normal",
        0
      );
    }
  } else {
    room.sendAnnouncement(
      "Sólo puedes cambiar de tamaño una vez por partido.",
      player.id,
      0xbfff35,
      "normal",
      0
    );
  }
  return false;
}
