function GetTeam(id) {
  return room
    .getPlayerList()
    .filter((player) => player.id != 0 && player.team == id);
}

function CreatePlayer(player) {
  ListaDeJugadores[ListaDeJugadores.length] = {
    name: player.name,
    id: player.id,
    auth: undefined,
    conn: undefined,
    jointime: 0,
  };
}

function DeletePlayer(id) {
  for (var i = 0; i < ListaDeJugadores.length; i++) {
    if (ListaDeJugadores[i].id == id) {
      ListaDeJugadores.splice(i, 1);
    }
  }
}

function GetPlayer(id) {
  for (var i = 0; i < ListaDeJugadores.length; i++) {
    if (ListaDeJugadores[i].id == id) {
      return ListaDeJugadores[i];
    }
  }
}

function GetIDByName(name) {
  for (var i = 0; i < ListaDeJugadores.length; i++) {
    if (ListaDeJugadores[i].name == name) {
      return ListaDeJugadores[i].id;
    }
  }
}

function GetAuthByID(id) {
  for (var i = 0; i < ListaDeJugadores.length; i++) {
    if (ListaDeJugadores[i].id == id) {
      return GetPlayer(ListaDeJugadores[i].id).auth;
    }
  }
}

function votekickRemove(player) {
  localStorage.setItem(
    GetPlayer(player.id).auth,
    JSON.stringify({ auth: GetPlayer(player.id).auth, votes: 0 })
  );
  var Jugadores = room.getPlayerList();
  for (var i = 0; i < Jugadores.length; i++) {
    if (votedPlayers.has(GetPlayer(Jugadores[i].id).auth) == true) {
      votedPlayers.delete(GetPlayer(Jugadores[i].id).auth);
    }
  }
}

